import { useNavigate } from "react-router-dom";

function LogOut() {

    const navigate = useNavigate();

    window.localStorage.removeItem("token")

    navigate("/");

    window.location.reload();


    render(

        <div className="div">

            <div id="darkened">


            <h1>You logged out.</h1>
            <h2>-------------------------------------------------</h2>




            </div>



        </div>











    )
}




export default LogOut
